INSERT INTO `v1_9a1c675bcbea47f438fdd7f1a21769644da54590f5690cf74ec1bba584919fb1` VALUES (0.75, 0.625, 11601, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。", 1, "ツムギのボトルキャップ", 6);
